import React from 'react';
import Navbar from './components/Navbar';
import Home from './components/pages/Home'
import {Switch,Route} from 'react-router-dom'
function App() {
  return (
    <> 
      <Navbar/>
      <Switch></Switch>
        <Route path='/' element={<Home/>} />


    </>
  );
}

export default App;
